import { createChatBotMessage } from "react-chatbot-kit";

const config = {
  botName: "NutriBot",
  initialMessages: [
    createChatBotMessage("Hello! How can I assist you today?"),
    createChatBotMessage("You can ask me about food nutrition, calories, or health tips!"),
  ],
  customStyles: {
    botMessageBox: {
      backgroundColor: "#5A67D8",
    },
    chatButton: {
      backgroundColor: "#5A67D8",
    },
  },
};

export default config;
